import { initializeApp } from "https://www.gstatic.com/firebasejs/10.5.2/firebase-app.js";
import { getStorage } from "https://www.gstatic.com/firebasejs/10.5.2/firebase-storage.js";
import {
  getFirestore,
  serverTimestamp,
} from "https://www.gstatic.com/firebasejs/10.5.2/firebase-firestore.js";

const firebaseConfig = {
  apiKey: "AIzaSyDpTNrYU2YT2evZUizkrjWRA0rTge8s7Ho",
  authDomain: "photos-app-80d9d.firebaseapp.com",
  projectId: "photos-app-80d9d",
  storageBucket: "photos-app-80d9d.appspot.com",
  messagingSenderId: "135000317162",
  appId: "1:135000317162:web:b3697ef8b521fe2348cb93",
};

// Initialize Firebase
const app = initializeApp(firebaseConfig);
const projectStorage = getStorage(app);
const projectFirestore = getFirestore(app);
const timeStamp = serverTimestamp();

export { projectFirestore, projectStorage, timeStamp };
